INSERT INTO `glossary` VALUES (312,'A','Absolute position','Exact position described by latitude and longitude co-ordinates '),(313,'A','Active sensing','Sensing signals transmitted from a device and reflected back to it'),(314,'A','Aerial photograph','A photograph taken from an aircraft'),(315,'A','Aggregation','Merging or adding smaller units together to form bigger units'),(316,'A','Alphanumeric grid','A grid of numbered rows and lettered columns (or vice versa) superimposed on a map and used to find and identify features'),(317,'A','Altitude','Height above sea level'),(318,'A','Area','The surface space occupied by a feature'),(319,'A','Area data','Features on a map that have a closed, two-dimensional shape'),(320,'A','Atlas index','A list of all the places and geographic features found on the maps in the atlas in alphabetical order'),(321,'A','Attribute data','Tabular or textual data describing the geographic characteristics or non-spatial information of features. Data that is stored as tables or as written text within the GIS database '),(322,'A','Attribute query','Selecting records based on the values of the data?s attributes'),(323,'A','Attributes','Also known as \'fields\' or \'columns\', the attributes that make up a record in a GIS and describe a feature.'),(324,'A','Average gradient','The average steepness of a slope we use terms such as gentle, moderate and steep to describe the gradient of slopes'),(325,'A','Axis','An imaginary line between the north and south pole around which the Earth rotates'),(326,'B','Bench mark','A mark on a map, indicated by an arrowhead, that gives the height of a significant place along a transport route'),(327,'B','Binary data','Encoded computer data that a human can\'t read. Images are normally stored in binary formats.'),(328,'B','Biomass','A type of energy made from renewable plant and animal materials'),(329,'B','Biomes','A large community of plants and animals living in an area'),(330,'B','Brandt line','An imaginary division that has provided a rough way of dividing all of the countries in the world into the rich north and poor south'),(331,'B','Buffer','A zone generated around a map object'),(332,'C','Cartogram','A map on which statistical information is shown in diagrammatic form'),(333,'C','Cartography','The art and science of map making'),(334,'C','Classification','Grouping continuous data into classes'),(335,'C','Climate','The long-term study of weather conditions for a region'),(336,'C','Climate change vulnerability','The degree to which geophysical, biological and socio-economic systems are susceptible to, and unable to cope with, adverse impacts of climate change'),(337,'C','Climatic regions','Areas with similar temperature and rainfall characteristics (largely determined by latitude)'),(338,'C','Co-ordinates','The point where lines of latitude/parallels and lines of longitude/meridians join or intersect'),(339,'C','Commercial farming','The production of crops, farm animals and dairy products for sale with the sole purpose to make a profit'),(340,'C','Commodity','Goods that are bought or sold'),(341,'C','Concave slope','The contours are close together at higher ground and then get further and further apart.'),(342,'C','Constructed features','Features of the landscape made by people'),(343,'C','Continentality','The effect distance from the sea has on climate. Coastal areas have maritime climates while inland areas have continental climates.'),(344,'C','Contour interval','The difference in height between the contour lines (also know as the vertical interval)'),(345,'C','Contour lines','Lines on maps that join places of equal height above sea level, they are brown on topographic maps and have an interval of 20 m'),(346,'C','Conventional energy sources','Traditional energy resources such as coal, oil and natural gas'),(347,'C','Conventional signs','A standardised set of icons or symbols used to represent features on a map'),(348,'C','Cross-section','A profile or side view of a relief feature or series of features'),(349,'D','Data','Any collection of related facts arranged in a particular format that are produced, stored or processed by a computer'),(350,'D','Data capture','Any operation that converts GIS data into computer-readable form'),(351,'D','Data integration','A process of putting data together'),(352,'D','Datum','A model of the surface of the Earth on which measurements are based'),(353,'D','DEM','Digital elevation model, a 3D representation of the surface of a terrain, in which each pixel represents elevation'),(354,'D','Demography','The study of population numbers and change'),(355,'D','Developed countries','Countries with a high level of health and wealth'),(356,'D','Developing countries','Countries with a low level of health and wealth but the development indicators show an improvement'),(357,'D','Digitising','The process of converting geographic features on a paper map into a digital format using a digitising tablet or a digitiser linked to a computer'),(358,'D','Direction','The relative position of one place to or from another'),(359,'D','Dispersed settlement pattern','Individual settlements or buildings are places far apart from each other'),(360,'D','Distribution','The spread of the data over its range'),(361,'E','Eco-hotspot','A biogeographic region with a significant reservoir of biodiversity that is under threat from humans'),(362,'E','Economic','To do with wealth and income'),(363,'E','Economic factors','To do with the wealth in a society ? how much people earn and the average standard of living in a country'),(364,'E','Editing data','Techniques designed to validate data, as well as correct errors and improve data quality '),(365,'E','Electromagnetic spectrum','The entire distribution of radiation or energy according to frequency or wavelength (from radio waves to gamma waves)'),(366,'E','Energy consumption','The rate at which energy is used up'),(367,'E','Environmental','To do with resources and the impact of human activities on the environment'),(368,'E','Equator','The intersection of the globe?s surface with the plane perpendicular to the axis of rotation and midway between the poles'),(369,'E','Equinox','The sun\'s rays are directly over the equator  the length of day and night is the same number of hours'),(370,'E','Escarpment','A large continuous feature that separates a large low-lying area from a large high-lying area'),(371,'F','Feature','A spatial entity in a GIS that represents, or \'models\', something in space (\'space\' in this context usually being the surface of the Earth)'),(372,'F','Fracking','The process of injecting liquid at high pressure into rocks (shales) to force open existing fissures and extract oil or gas'),(373,'G','Gentle slope','A slope that has a small height difference between two places and the contour lines are far apart'),(374,'G','Geo-reference','Data that is linked to a geographic co-ordinate'),(375,'G','Geostationary satellites','Satellites that are positioned at a higher-altitude and hover over the same area'),(376,'G','Global maps','Small-scale maps of the world, maps of the continents'),(377,'G','Global trade','The worldwide exchange of goods and services'),(378,'G','Globalisation','The increasing connection between countries that has been made possible by improved transport, technology and the influence of powerful companies'),(379,'G','Google Earth','Google Earth lets you fly anywhere on Earth to view satellite imagery, maps, terrain, 3D buildings, from galaxies in outer space to the canyons of the ocean'),(380,'G','GPS','Global positioning system, a system of satellites used to determining positions on Earth'),(381,'G','Gradient','The angle or steepness of a slope'),(382,'G','Greenwich Meridian','The 0? line of longitude that passes through Greenwich, a suburb of London, and through both poles'),(383,'G','Grid referencing','The numbering of degree squares formed by the intersections of lines of latitude and longitude'),(384,'G','Gross domestic product (GDP)','The value of all the finished goods and services produced within a country\'s borders in one year'),(385,'G','Gross national income (GNI)','The value of all goods and services produced in a country in one year'),(386,'G','Ground distance','The distance between two features in reality (on the Earth\'s surface), usually measured in kilometres'),(387,'G','Ground uplink station (GUS)','A precisely surveyed ground station that monitors and collects information from navigation satellites'),(388,'H','Hachures','Short black or brown lines used to represent downward sloping or elevated relief (The lines point downslope.)'),(389,'H','Hemisphere','A \'half\' of the Earth ? the equator divides the Earth into the northern and southern hemisphere, the Greenwich meridian and the 180? line of longitude divides the Earth into the western and eastern hemispheres'),(390,'H','High angle oblique aerial photograph','A photograph that is taken when the camera lens is tilted approximately 60? to the vertical (the horizon can be seen)'),(391,'H','Horizontal photograph','A photograph that is taken when the camera is parallel to the horizon'),(392,'H','Horizontal rock strata','Layers of rock that were deposited one on top of the other to the horizon'),(393,'H','Human development index (HDI)','An index that measures wealth, education and health'),(394,'I','Imported','Goods and commodities brought into the country from other countries for sale'),(395,'I','Inclined rock strata','Horizontal rock strata that have been tilted to form asymmetrical features'),(396,'I','Index','An alphabetical list of places and features with reference to the pages on which they can be found'),(397,'I','Index contours','Bold contour lines on topographic maps that are at 100 m intervals'),(398,'I','Infant mortality rate','The number of infants dying before reaching one year of age'),(399,'I','Infrastructure ','The basic physical and organiSational structures and facilities (e.g. buildings, roads, power supplies) needed for the operation of a society or enterprise'),(400,'I','International Date Line','The 180? line of longitude opposite the Greenwich Meridian where time changes by one day between the eastern and western hemispheres'),(401,'I','Internet','The world wide interconnection of individual networks operated by government, industry, academia and private parties'),(402,'I','Interoperability','A situation where diverse organisations and systems can share data and work together seamlessly'),(403,'I','Interpolation','A method of constructing new data points within the range of a discrete set of known data points'),(404,'I','Intervisibility','The ability to see between two seperate points on a landscape without any part of the landscape blocking the view'),(405,'I','Irregular area','The area of an object or feature whose shape is organic (not regular) ? the organic shape does not allow us to use the formula A = L X W to determine the area of the feature'),(406,'K','Key','The list of conventional signs applicable to a specific map'),(407,'L','Land use','The main function that the land is used for'),(408,'L','Landsat image','A satellite image that collects data from a range of observation bands'),(409,'L','Landscape features','Physical features that can be identified on the land'),(410,'L','Large-scale maps','Maps that show small areas but a lot of detail, e.g. street maps'),(411,'L','Latitude','The angular distance measured in degrees north of south from the centre of the Earth, the resultant lines form concentric circles and are also called parallels.'),(412,'L','LEDC','Less Economically Developed Country'),(413,'L','LIDAR','Light Detecting And Ranging, a type of aircraft-based remote sensing, using laser-driven pulses of light'),(414,'L','Line','A series of (x, y) co-ordinates joined together, with each having the same (z) feature (e.g. a road or river)'),(415,'L','Line data','A map feature that has length but not area, such as a river on a world map or a contour on a topographic map'),(416,'L','Line scale','A linear diagram on a map that shows what a distance measured on the map would be in reality'),(417,'L','Line scale','A line marked off in centimetre markings showing what each centimetre represents on the ground'),(418,'L','Line/linear scale','A line marked off in centimetre markings showing what each centimetre represents on the ground'),(419,'L','Livestock farming','Livestock such as cattle, sheep, pigs and goats are raised in an agricultural setting to produce food and animal products (milk)'),(420,'L','Local maps','Larger-scale maps of provinces, maps of one country'),(421,'L','Longitude','The angular distance measured in degrees east and west from the central meridian'),(422,'L','Low angle oblique aerial photograph','A photograph that is taken when the camera lens is tilted approximately 30? to the vertical (the horizon is not visible)'),(423,'M','Magnetic bearing','Bearing measured from magnetic north, i.e. true bearing plus magnetic declination'),(424,'M','Magnetic declination','The angle between true north and magnetic north'),(425,'M','Map distance','The distance between two features on the map ? it is scale dependent and usually measured in centimetres'),(426,'M','Map reference number','The unique four-digit, two-letter title given to each 1:50 000 topographic map in South Africa'),(427,'M','Map scale ','The relationship between distance on a map and the corresponding distance on the ground'),(428,'M','Massive igneous strata','Igneous rocks that cover a large area and were formed at great depth beneath the Earth\'s surface'),(429,'M','MEDC','More Economically Developed Country'),(430,'M','Mediterranean','Areas that experience hot, dry summers and warm, wet winters'),(431,'M','Mesa','A flat-topped hill that is wider than it is high'),(432,'M','Minimum mapping unit','The smallest object that is mapped, also known as the smallest addressable unit'),(433,'M','Model','A smaller realistic copy of a real 