 signs and names of roads and places) superimposed onto it'),(451,'O','Overlays','Spatial data layers'),(452,'P','Panchromatic','Sensors that are sensitive to light of all wavelengths in the visible spectrum'),(453,'P','Pass','A low-lying area between two higher lying hills (also known as saddle)'),(454,'P','Passive sensing','Sensing radiation that is naturally emitted or reflected by Earth or the atmosphere'),(455,'P','Pattern','A significantly different shape from the norm'),(456,'P','Perennial river','A river that flows all year round, depicted by a solid blue line on a map'),(457,'P','Perpendicular','Vertical line, forming a right angle with the horizontal plane'),(458,'P','Pixels','The smallest unit in which raster data is stored, making up a regular grid of cells that are referenced in rows and columns'),(459,'P','Plan view','The view from above an object or feature'),(460,'P','Point','A feature displayed at one particular (x, y) location (e.g. information received from a GPS)'),(461,'P','Point data','A map feature that has no length or area, such as a spot height on a topographic map'),(462,'P','Polar-orbiting satellites','Satellites placed at 500?800 km above Earth, also called lower-orbiting satellites'),(463,'P','Polygon','A series of (x, y) co-ordinates that join together to complete a boundary (e.g. a vegetation type or land use zone)'),(464,'P','Primary data sources','Datasets collected in digital format specifically for use in a GIS project'),(465,'P','Profile view','The side view of an object or feature'),(466,'P','Projection','A method by which the curved surface of the Earth is portrayed on a flat surface'),(467,'Q','Querying','Selecting or filtering data'),(468,'R','Ratio','A relationship between two quantities that compares one number to another number of the same unit'),(469,'R','Ratio scale','A scale that represents the same unit of measurement on both the map and the ground. For topographic maps the ratio scale is 1:50 000.'),(470,'R','Record',