t varying wavelengths that can uniquely identify an object'),(508,'S','Spheroid','A shape that approximates a sphere. The Earth is a slightly unevenly \'squashed\' sphere. The radius to the poles is shorter than the radius to the equator. Earth\'s particular spheroid is also known as a \'geoid\'.'),(509,'S','Spot height','A dot on a map with a height next to it representing the height of a point on the Earth\'s surface'),(510,'S','Spurs','The contour pattern showing spurs is U-shaped, pointing down slope towards lower ground.'),(511,'S','Statistical analysis','A collection of methods used to process large amounts of data and report overall trends'),(512,'S','Steep slope','A slope that has a big difference in height between two places and the contour lines are close together'),(513,'S','Straight line distance','The direct distance measured between two points on a map, sometimes referred to \'as the crow flies\''),(514,'S','Subsistence farming','Self-sufficiency farming in which the farmers focus on growing enough food to feed themselves and their families'),(515,'S','Sustainable','Able to be used at the same rate for a long time without threatening the supply'),(516,'T','Temperature range','The difference between high and low temperatures for a particular place'),(517,'T','Temporal data','Data that specifically refers to times and dates'),(518,'T','Temporal resolution','The time it takes for a satellite to take an image of the exact same area on the Earth'),(519,'T','Texture','The impression (or \'feel\') of smoothness or roughness of features on a photograph. Other words used to describe texture include: coarse, fine, mottled, patchy, striped or spotted.'),(520,'T','Tilt','Inclined at an angle'),(521,'T','Time zone','One of the 24 divisions of earth that have the same time'),(522,'T','TIN','Triangulated irregular network, in which points are joined as triangles, often used in \'gaming\' to represent relief and the terrain'),(523,'T','Tone ','The degree of lightness 