INSERT INTO `help_faq_questions` VALUES (1,1,'How can I buy the Platinum Interactive Skills Atlas?','Please go the Pearson eStore at http://shop.pearson.co.za/ or click on the BUY NOW button on the Login page.'),(2,1,'Is there a demo version available for me to play with?','There is no demo available, but have a look at the Interactive Skills Atlas video to see what the product offers.'),(3,1,'How is this different to Google Maps?','The Interactive Skills Atlas is written specifically for South African learners and follows the CAPS curriculum. It covers Atlas, Map and GIS Skills for grades 8 - 12.'),(4,1,'What if I have a question about my Platinum Interactive Skills Atlas?','You can send us an email using \'How can we help you\' and we will get back to within 48 hours to resolve your question.'),(5,1,'Can I download the videos in the product? ','No, you will need to access it online at www.digitalatlas.pearson.co.za'),(6,1,'What do I need to do to get access to the Platinum Interactive Skills Atlas?','You will need to buy the product through the Pearson eStore at http://shop.pearson.co.za/ and click on the link sent to you to register your product. You would then be able to access the Interactive Skills Atlas.'),(7,1,'Can I share my Platinum Interactive Skills Atlas with anyone else?','No, the access belongs to you as the owner.'),(8,1,'Can I use the Platinum Interactive Skills Atlas on multiple devices at the same time?','No. You can only have it active on 1 device at a time.'),(9,1,'When does my licence period become active?','The licence period will run from the date you registered your product.'),(10,1,'Is the Digital Atlas secure?','Yes, as you create a personalised profile and password known only to you.'),(11,1,'What devices can I use the Platinum Interactive Skills Atlas on?','Windows desktop, laptops and Android tablets.'),(12,1,'Will the Platinum Interactive Skills Atlas work on Apple devices?','No, it is not yet optimised for Apple devices.'),(13,1,'Does this product work on windows platforms?','Yes.'),(14,1,'The FAQ is not solving my problem, how can I can get in contact Customer Support?','Use the \'How can I help you\' feature to send us an email detailing your issue and we will get back to you within 48 hours.'),(15,1,'Will I be abe to print my notes?','We will make printing notes as an option in future versions of the product'),(16,1,'How do I know when there will be product updates ?','New content will be pushed to you.'),(17,1,'How do I find the help?','Click on the \'Support\' button at the top right of the login screen, or on the \'Help\' button on the Learner Dashboard.'),(18,1,'How do I contact the Customer Support when I need help?','Click on the \'Support\' button at the top right of the login screen, or on the \'Help\' button on the Learner Dashboard.'),(19,1,'Will there be product updates and how do I access them?','Product updates will be pushed to you as the customer. You do not have to do anything.'),(20,1,'How can I get copy of payment receipt','An email will be sent to you confirming your purchase and will have your payment receipt.'),(21,1,'What currencies can I use to buy this product?','South African rands only.'),(22,1,'Do I get a discount if I buy for more than one child simultaneously?','We can offer discounts on bulk purchasing for schools.'),(23,1,'What payment methods are available?','You can pay using a credit or debit card or an EFT transfer.'),(24,1,'What skills does the Interactive Skills Atlas focus on?','The skills covered are Mapwork skills that learners need in order to answer their Paper 2 grade 12 final exam and include Atlas, Map and GIS skills across grades 8 - 12.'),(25,1,'How many grades will be available on this product?','The Interactive Skills Atlas comprehensively covers the mapwork skills required from grades 8 - 12.'),(26,1,'What languages are supported?','English.'),(27,1,'How do I navigating through the Interactive Skills Atlas?','There are multiple ways one can navigate through the Interactive Skills Atlas using the Learner Dashboard.'),(28,1,'Do I have to do the Skills in any particular order?','No, you can select which Skills Activities you would like to practice.'),(29,1,'How do I personalise my Interactive Skills Atlas?','Create your own profile and choose your avatar or add your own image'),(30,1,'How many times can I practice a skill?','As many times as you would like to.'),(31,1,'How do I change my password?','Go into your profile page and \'Change your password\'. '),(32,1,'What if I forget my password?','On the Login page click on the \'Forgot Password\' button, enter your email address and click send. We will  send you your password.'),(33,1,'Can I only see my ePub notes in the ePub.','You can see your ePub notes and your Skills notes all  together in the \'My Notes\' feature on the learner dashboard..'),(34,1,'Is the glossary only available for the grade you have purchased?','The glossary is a comprehensive glossary for grades 8 - 12 terms and is available irrespective of the product you have purchased.'),(35,1,'Are the Resources only for the grade you have purchased?','No, the Reources feature has all the resources from grades 8 - 12 available to everyone.'),(36,1,'What do I do if I enter the incorrect username or password?','We will send you a message to tell you the incorrect username or password has been entered and give you the opportunity to enter the correct username or password.'),(37,1,'Do I have to complete the Skills Activities in the any specific order. ','No. You can choose which Skills Activities you would like to practice.'),(38,1,'Must I complete a Skills Activity before I can get a badge?','Yes. You can only earn badges on completed Skills Activities.'),(39,1,'Must I complete all the questions in a Skills Activity or can I answer a few questions and then move on ?','You do not have to complete all the questions in a Skills Activity before moving on.'),(40,1,'What web browsers does the Platinum Interactive Skills Atlas work in?','Chrome, Firefox. Windows IE'),(41,1,'Can I just have a look at the resources without having to go into the Skills Activities?','Yes, go to the Resources feature.'),(42,1,'How do I track my progress in a grade?','You can track your progress by grade by viewing the overall progress bar on your profile page.'),(43,1,'How do I know how many of the questions I have completed, got right or wrong in a Skills Activity?','Each Skills Activity progress bar will shown you the number of questions attempted, correct, incorrect and not attempted.'),(44,1,'Where do I find the correct answers to the questions?','Feedback is given for each question once you have answered it and pressed check'),(45,1,'Can I just look at the animations?','Yes, go to Resources, animations.');
/*!40000 ALTER TABLE `help_faq_questions` ENABLE KEYS */;
UNLOCK TABLES;

