INSERT INTO `helphowto` VALUES (1,'support-page','This is a test query from the Digital Atlas Support Page.','Nguni','Phakela','nguni.phakela@pearson.com','0117773333','2015-09-06 20:03:53','true'),(2,'support-page','This is another test query from the support page of DA.','Nguni','Phakela','nguni.phakela@pearson.com','0113334455','2015-09-06 20:46:47','true'),(3,'support-page','I have purchased a copy of your grades 10 to 12 Interactive Atlas. After purchasing a copy of your Grade 8/9 Interactive Atlas, I tried to register, but could not. The error message was that I was using a duplicate email address. Your system is thus set up in such a manner that one cannot purchase more than one product on the same email system for your Interactive Atlas.\r\n\r\nWhen I purchase the grades 10 to 12 Interactive Atlas I received a password via email. I did not receive such an email after I purchased the Grade 8/9 Interactive Atlas.','John','Lanser','jlanser@bishops.org.za','0846225699','2015-09-12 19:13:25','true');
