DROP TABLE IF EXISTS `user_skill`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `user_skill` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(35) NOT NULL,
  `number_of_questions` int(11) NOT NULL,
  `number_of_right` int(11) NOT NULL,
  `number_of_wrong` int(11) NOT NULL,
  `questions_tried` int(11) NOT NULL,
  `total_questions` int(11) NOT NULL,
  `quizname` varchar(25) NOT NULL,
  `rate` varchar(25) NOT NULL,
  `total` varchar(25) NOT NULL,
  `badge` varchar(10) DEFAULT NULL,
  `mood` varchar(10) DEFAULT NULL,
  `grade` int(11) NOT NULL,
  `date_created` datetime DEFAULT NULL,
  `date_modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=108 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

